import React from "react";

export default class AddContact extends React.Component {
    render() {
        console.log(this.props.onAddnewContact)
        return (
            <div>
                <button className="megabutton" onClick={this.props.onAddnewContact}>Add new Contact</button>
            </div>
        );
    }
}
